    false,nt"url": null,nt"notes": "This annual narrative report for Illinois
    River National Wildlife and Fish Refuges Complex summarizes refuge activities during
    the 1992 calendar year.  The report begins with a summary of the yearu2019s highlights
    and climatic conditions.  Land acquisition - including fee titles and easements
    topics are also covered.  The report includes a planning section which discusses
    refuge management plans and compliance projects.  Refuge administration is outlined;
    information about personnel, refuge programs, funding and safety is given.  Habitat
    management is also covered.  Subjects include grasslands, pest control, conservation
    easements, and private lands.  The wildlife section of the report discusses endangered
    or threatened species, migratory birds, game mammals, fisheries resources, scientific
    collections, and banding. The public uses of the refuge described in this report
    include interpretive programs, hunting, wildlife observation, and law enforcement.
     The equipment and facilities section of the report provides information about
    new construction, maintenance, computer systems, and energy conservation.  Items
    of interest are provided at the end.",nt"license_title": "License Not Specified",nt"extras":
